import { createStyles, List, ListSubheader, makeStyles, Theme } from '@material-ui/core'
import React from 'react'


const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            width: '100%',
            maxWidth: 360,
            backgroundColor: theme.palette.background.paper,
        },
        nested: {
            paddingLeft: theme.spacing(4)
        },
    }),
)

{/* <header>
<p>
  Android development, Kotlin, Java
  Threads and coroutines
  SQLite both raw queries and Room library
  TCP sockets, Http requests, Retrfoit
  C++ Qt5/QML (desktop and mobile applications)
  Creating applications to work with hardware devices (card readers, printers)
  Common markdown languages: Json, XML
  Html, Css
</p>
</header> */}


export default function SkillsList() {
    const classes = useStyles()
    const [open, setOpen] = React.useState(true)

    const handleClick = () => {
        setOpen(!open);
    }

    return (
        <List
            component="nav"
            aria-labelledby="nested-list-subheader"
            subheader={
                <ListSubheader component="div" id="nested-list-subheader">
                    Skills
                </ListSubheader>
            }
            className={classes.root}
        >


        </List>

    )

}
